const shopData = [];

function dummyDataGenerator() {
  const newData = {};
  newData.id = shop_data.length + 1;
  newData.name = `Doggie ${newData.id}`;
  newData.imageUrl = 'https://dog.ceo/api/breeds/image/random';
  newData.price = Math.floor(Math.random() * 10) + 1;

  shopData.push(newData);
}

dummyDataGenerator();

export default shopData;
